let state = {
    posts: [
        { message: "Congratulation!", like: "999999999999999999999999999999999999999999999999999999999999999999999999999999999999" },
        { message: "YOU'VE DONE IT!", like: "999999999999999999999999999999999999999999999999999999999999999999999999999999999999" },
    ],
    dialogs: [
        { id: 1, name: "Sasha" },
        { id: 2, name: "Ira" },
        { id: 3, name: "Nadia" },
        { id: 4, name: "Olya" },
        { id: 5, name: "Lena" },
    ],
    messages: [
        { message: "HI" },
        { message: "MY NAME IS SASHA" },
        { message: "I LOVE KLYMENKO SO MUCH!" },
    ]
}

export default state;
